import React from 'react'
import image1 from '../../resources/images/ImagePlaceholder.png';
import './Home.css'

export default function DisplayCarousell() {
  return (
    <div>
     <div className="placeholder"><img src={image1} alt="" srcset="" className='backdropimage' width="100%"/></div>
    </div>
  )
}
